import React, { useState } from 'react'; // import 로 useState 를 불러온다!
import styled from 'styled-components';
const LeftArea = () => {
    const MainSection = styled.section`
        margin: 0px;
        padding:0px;
`; //ContentWarp 메인 css
    const WarpSection = styled.div`
        margin: 0 16vw;
    `;
    const LeftSection = styled.main`
        display: flex;
        justify-content: space-between;
    `;
    const Title = styled.h1`
        margin: 60px 0 27px;
    `;
    const TitleText = styled.p`
        color:#3669c5;
        font-size: 24px;
        font-weight: 700;
        line-height: 27px;
    `;
    const SecondText = styled.p`
        color:#000;
        font-size: 24px;
        font-weight: 700;
        line-height: 0px;
    `;
    const InputArea = styled.div`
        width: 350px;
    `
    return(
        <MainSection>
            <WarpSection>
                <LeftSection>
                    <section>
                        <Title>
                            <TitleText>
                                당신의 이야기를 들려주세요,
                            </TitleText>
                            <SecondText>
                                무엇이든 괜찮아요!
                            </SecondText>
                        </Title>
                        <InputArea>
                            
                        </InputArea>
                    </section>
                </LeftSection>
            </WarpSection>
        </MainSection>
    )
}
export default LeftArea;
